import classes from './Card.module.css'
import { Link } from 'react-router-dom';


const Card = (props) => {

    const fetchInfo = async (event) => {
        try {
            event.preventDefault()
            const req = await fetch(`http://localhost:1337/job`, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                }
            });
            // const data = await req.json()
            if (!req.ok) {
                throw new Error(req.message)
            }
        } catch (err) {
            console.log(err)
        }
    }

    props.onFetchJob(props.title)

    return (
        <div onClick={fetchInfo} as={Link} to='auth' className={classes.card}>
            {/* <Link to='/auth'></Link> */}
            <h3>{props.title}</h3>
            <p>{props.location}</p>
            <p>{props.type}</p>
            <p>{props.description}</p>
        </div>
    )

}


export default Card
